column5:
@interRAI_Hirdes @UWaterloo @yourWUSA @UWaterlooPres @yourwusaVPOF @1cplante @UWStaffAssoc From Deputy Speaker's report: 

Council has elected to remove a Councillor in @WaterlooMath caucus due to truancy by a vote of 17-3-2, with one Councillor excluding themselves on the basis of inability to submit a ballot. 

@MathSoc may now fill the vacancy with a pro tem member.
